import React from "react";

function handleSave() {
  console.log("save clicked");
}
const MovieForm = ({ match }) => {
  return (
    <React.Fragment>
      <h1>Movie Form {match.params.id} </h1>
      <button className="btn btn-secondary btn-sm" onClick={handleSave}>
        Save
      </button>
    </React.Fragment>
  );
};

export default MovieForm;
